import { newAllQuestionKeyCombinationArray } from "./keyCreator";
let emptyKeyArray = [
  "public_seafarer_recruitment",
  "private_seafarer_recruitment",
  "prevent_or_deter",
  "labour_market_including",
  "srps_have_operational",
  "placement_services_stating",
  "employment_not_permitted",
  "personal_travel_documents",
  "if_not_who",
  "recruitment_process_recommended",
  "fees_for_such",
  "recruited_or_placed",
  "by_srps_including",
  "which_should_include",
  "contacted_in_an",
  "or_advice_by",
  "no_seafarer_under",
  "works_on_board",
  "restrictions_on_night",
  "placed_are_informed",
  "staff_responsible_for",
  "particular_shipowners_policies",
  "accordance_with_national",
  "proper_arrangements_for",
  "on_ships_where",
  "accordance_with_flag",
  "valid_medical_certificate",
  "duly_qualified_licensed",
  "engaged_in_international",
  "per_mlc_reg",
  "complaint_concerning_its",
  "agreements_are_signed",
  "compensate_seafarers_for",
  "srps_or_by",
  "opportunities_for_exploitation",
  "have_a_policy",
  "references_are_verified",
];

function StructureCreator({ serialNo, question, num, keyCreator, extraField }) {
  keyCreator(question);

  const structureHTML = `
    <div class="section">
              <div class="rows">
                <div class="col-1 text-center">
                  <p class="num-label">${serialNo}</p>
                </div>
                <div class="col-11">
                  <label class="ors-form-label">${question}</label>
                  <div class="rows">
                    <div class="col-3 main-radio" data-fieldtype="radio-group" data-bind="foreach:{
                        data:[
                          {id:'yes',label:'Yes'},
                          {id:'no',label:'No'}
                        ],
                        as:'option'
                      }">
                      <div class="radio-common"
                        data-bind="css:{'selected':vm.formData.${
                          emptyKeyArray[num - 1]
                        }()===option.id}">
                        <input type="radio" name="${
                          emptyKeyArray[num - 1]
                        }" data-bind="
                            checkedValue: option.id,
                            checked: vm.formData.${
                              emptyKeyArray[num - 1]
                            }, 
                            attr:{
                              id:'${
                                emptyKeyArray[num - 1]
                              }'+'-'+option.id,disabled:vm.isReadOnlyField('${
    emptyKeyArray[num - 1]
  }')
                            }" />
                        <label
                          data-bind="text:option.label, attr:{for:'${
                            emptyKeyArray[num - 1]
                          }'+'-'+option.id}"></label>
                      </div>
                    </div>
                    <div class="col-9 ors-form-control textarea-input" data-fieldtype="textarea">
                      <textarea class="textarea-text" name="${
                        newAllQuestionKeyCombinationArray[num - 1]
                      }_remarks"
                        placeholder="Remarks by Auditor" style="height: 30px;"
                        data-bind="expandable:{min:1},value:vm.formData.${
                          newAllQuestionKeyCombinationArray[num - 1]
                        }_remarks,attr:{readonly:vm.isReadOnlyField('${
    newAllQuestionKeyCombinationArray[num - 1]
  }_remarks')}"></textarea>
                    </div>
                  </div>
                </div>
              </div>
            </div>
               `;
  return (
    <>
      {structureHTML} <br />
    </>
  );
}
export default StructureCreator;
